import React from 'react'
import "./Navbar.css"

const navbar = () => {
  return (
    <nav>
    <a href="/">Home</a>
    <a href="/about">About</a>
    <a href="/github">Github</a>
    <a href="/">Logout</a>
  </nav>
  )
}

export default navbar
